type GreetProps ={
    name:string
    messageCount: number
    isloggedin: boolean
}

export const Greet=(props:GreetProps)=>{
    return(
        <div>
        <h2>{props.isloggedin ?'welcome {props.name}  jodd  you have {props.messageCount} message'
                                :'Welcome to Team SouL '}</h2>
        </div>
    )
}
